// src/components/AboutMe.js
import React from 'react';

const AboutMe = () => {
    const styles = {
        about: {
            padding: '4rem 2rem',
            backgroundColor: 'transparent',
            color: 'var(--text-color)',
            textAlign: 'center'
        },
        title: {
            fontSize: '2rem',
            marginBottom: '1rem',
            color: 'var(--accent-color)'
        },
        achievementsList: {
            listStyle: 'none',
            padding: 0,
            maxWidth: '800px',
            margin: '2rem auto',
            textAlign: 'left'
        },
        achievementItem: {
            margin: '0.75rem 0',
            padding: '1rem',
            background: 'rgba(255, 255, 255, 0.1)',
            backdropFilter: 'blur(8px)',
            borderRadius: '5px',
            border: '1px solid rgba(255, 255, 255, 0.2)',
            boxShadow: '0 2px 5px rgba(0, 0, 0, 0.1)',
            fontSize: '1rem'
        }
    };

    return (
        <section style={styles.about}>
            <h2 style={styles.title}>About Me</h2>
            <ul style={styles.achievementsList}>
                {/* Add your achievement items here */}
                <li style={styles.achievementItem}>Achievement 1</li>
                <li style={styles.achievementItem}>Achievement 2</li>
            </ul>
        </section>
    );
};

export default AboutMe;
